import React, { useState } from 'react';

function Button(props) {

    const [count, setCount] = useState(0);

    function handleChange(e) {
        setCount(count);
        props.onCountChange(count); // appel de la fonction de rappel avec la nouvelle valeur
      }


    return (
        <button 
            className={"button " + props.styleclass} 
            onClick={() => setCount(count + 1)}>
                {props.label + " " + count}
        </button>
    );
  }

  export default Button;
